window.bookSummaryJSON = "<p><b>Only the strong rise from despair. Only the strong can take betrayal and batter it into submission. The Stranglandermen are no more.</b></p> <p>In <i>Dragon’s Mist</i>, we saw him establish his castle. In <i>Dragon’s Born</i>, he secured his land. In <i>Dragon’s Realm</i>, he exterminated a mortal enemy, and in <i>Dragon’s Knight</i>, he took his continent. Now, three continents gather to wipe Connor and his knights from the Circle Sea. Can Connor survive their combined might?</p> <p>And what of Dave, the maverick Englishman? Will he become useful, or remain the fool?</p> <p><i>Dragon’s End</i> completes the epic 4X city-building LitRPG saga, Warlords of the Circle Sea. At over a million words, it is a comprehensive tribute to hours, days, and weeks spent playing MMORPGs of varying flavors.</p> <p>Contains: curse words, heartbreak, and a mad Englishman.</p>"; 
